import React from "react"
import image from "./happy.jpg"
import CardSignup from "./CardSignup"
function Image() {
    return (
    <div className="main-div row" style={{position:"relative"}}>
        <div style={{position:"absolute",left:"45px"}}>
            <img src={image}></img>
        </div>
        <div style={{display:"inline-block"}}>
            <div style={{position:"absolute",right}}>
                <h1 style={{}}>ankit</h1>
            </div>
        </div>
    </div>
    )
}
export default Image;
//fontFamily:"'Baloo Da 2'
